package com.smile.model;import jakarta.persistence.Entity;import jakarta.persistence.GeneratedValue;import jakarta.persistence.GenerationType;import jakarta.persistence.Id;import lombok.AllArgsConstructor;import lombok.Getter;import lombok.NoArgsConstructor;import lombok.Setter;@Entity@AllArgsConstructor@NoArgsConstructor@Getter@Setterpublic class User {    @Id    @GeneratedValue(strategy = GenerationType.AUTO)    private Long id;    private String name;    private String phoneNumber;    private int age;    private String email;    private String response;}